const Chat = () => {
    return(
        <div className="chat">

            <style jsx>
                {
                    `
                    .chat {
                        width: 100%;
                        height: 50px;
                        background: red;
                    }
                    
                    `
                }
            </style>
        </div>
    )
}


export default Chat;
